import image from '../images/person-icon.png';
import simoneImage from '../images/Simone Bliss.JPG';

const tileData = [
  {
    img: simoneImage,
    name: 'Simone Bliss',
    role: 'Fullstack',
    description: 'Math',
  },
  {
    img: image,
    name: 'Serena Chan',
    role: 'Information Support',
    description: 'Major',
  },
  {
    img: image,
    name: 'Stephen Li',
    role: 'ML',
    description: 'Major',
  },
  {
    img: image,
    name: 'Henry Noren',
    role: 'Simulation',
    description: 'Major',
  },
];

export default tileData;
